export const Dashboard = () => {
  useProtectedPage()
  const auth = useContext(AuthContext)
  const [email, name] = [auth.user.email, auth.user.name]

  return (
    <Styled.Dashboard>
      <Header />
      <Styled.SessionData onClick={() => console.log(email)}>
        {/* <Styled.Text><b>Email: </b>{user.email}</Styled.Text> */}
      </Styled.SessionData>
      <Styled.Documentation>Documentação</Styled.Documentation>
    </Styled.Dashboard>
  )
}
